import React from 'react';

function GoalsPage() {
    return (
        <div>
            <h1>My Goals</h1>
            <ul>
                <li>Goal 1</li>
                <li>Goal 2</li>
                <li>Goal 3</li>
            </ul>
        </div>
    );
}

export default GoalsPage;
